(214, 'Les 7 P du marketing', 'Le marketing mix est le grand classique du marketing opérationnel. Il décrit l\'ensemble des mesures définies pour atteindre les objectifs du marketing. Pendant longtemps, le mix était constitué de 4 P : Product (produit), Price (prix), Place (distribution et logistique) et Promotion (promotion). Cependant, le concept des 4 P ne s\'applique au secteur des services que dans une mesure limitée. Les experts en marketing ont donc développé le concept des 7 P : voici plus de détails concernant les 7 P du marketing. \r\n\r\nLes 7 P du marketing', '1646937207.docx', '', 'docx', '2022-03-10 18:33:27', '2022-03-11 00:33:27', 41, 144, 1),
